css:
.gutter[gutter-name=diagnostics-gutter] {
  min-width: 0.5em;
}
.diagnostics-gutter-ui-gutter-error,
.diagnostics-gutter-ui-gutter-warning,
.diagnostics-gutter-ui-gutter-info {
  text-align: left;
  display: block;
  width: 0.8em;
  transform: scale(0.7);
  transform-origin: left;
}
.diagnostics-gutter-ui-gutter-error::before,
.diagnostics-gutter-ui-gutter-warning::before,
.diagnostics-gutter-ui-gutter-info::before {
  font-family: 'Octicons Regular';
  font-weight: normal;
  font-style: normal;
  display: inline-block;
  line-height: 1;
  -webkit-font-smoothing: antialiased;
  text-decoration: none;
  font-size: 130%;
  width: 130%;
  height: 130%;
  content: "\f05a";
}
.diagnostics-gutter-ui-gutter-error {
  color: #ff6347;
}
.diagnostics-gutter-ui-gutter-warning {
  color: #e2c08d;
}
.diagnostics-gutter-ui-gutter-info {
  color: #6494ed;
}
